import React, { useContext } from 'react'
import { AuthContext } from '../Context/AuthContext'

export default function AuthSec({children}) {
    const {token} = useContext(AuthContext)
  return (
    <>
    {
    !token ? <children /> : navigator("/")
}
    </>

  )
}
